import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Home';

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Routes>
          <Route path="/" exact component={Home}/>
        </Routes>
      </Router>

      <h1>Test 1</h1>
    </>
  );
}

export default App;
